import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import HomeScreen from './components/home.js';
import VendorScreen from './components/vendor.js';
import BridalDressScreen from './components/bridaldress.js';
import CatererScreen from './components/caterer.js';
import MakeupScreen from './components/makeup.js';
import PhotographerScreen from './components/photographer.js';
import VenueScreen from './components/venue.js';

const RootStack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <RootStack.Navigator initialRouteName="Home">
        <RootStack.Screen 
          name="Home" 
          component={HomeScreen}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            // headerTintColor: '#fff',
          }} 
        />
        <RootStack.Screen name="Vendor" component={VendorScreen} />
        <RootStack.Screen name="BridalDress" component={BridalDressScreen} />
        <RootStack.Screen name="Caterer" component={CatererScreen} />
        <RootStack.Screen name="Makeup" component={MakeupScreen} />
        <RootStack.Screen name="Photographer" component={PhotographerScreen} />
        <RootStack.Screen name="Venue" component={VenueScreen} />
      </RootStack.Navigator>
    </NavigationContainer>
  );
};

export default App;
